            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div class=\"pgmonospaced pgheader\">\n<br>The Project Gutenberg EBook of The Eyes Have It, by Philip Kindred Dick\n<br>\n<br>This eBook is for the use of anyone anywhere at no cost and with\n<br>almost no restrictions whatsoever.  You may copy it, give it away or\n<br>re-use it under the terms of the Project Gutenberg License included\n<br>with this eBook or online at www.gutenberg.org\n<br>\n<br>\n<br>Title: The Eyes Have It\n<br>\n<br>Author: Philip Kindred Dick\n<br>\n<br>Release Date: March 6, 2010 [EBook #31516]\n<br>\n<br>Language: English\n<br>\n<br>\n<br>*** START OF THIS PROJECT GUTENBERG EBOOK THE EYES HAVE IT ***\n<br>\n<br>\n<br>\n<br>\n<br>Produced by Greg Weeks, Barbara Tozier and the Online\n<br>Distributed Proofreading Team at https://www.pgdp.net\n<br>\n<br>\n<br>\n<br>\n<br>\n<br>\n<br></div></div>"
