            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>This etext was produced from <cite>Science Fiction Stories</cite> 1953. Extensive research did not uncover any evidence that the U.S. copyright on this publication was renewed.</div></div>"
        },
