            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000007": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000007",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote><div><p>A little whimsy, now and then, makes for good balance. Theoretically, you could find this type of humor anywhere. But only a topflight science-fictionist, we thought, could have written this story, in just this way….</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000008": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000008",
