        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000009": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000009",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000010": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000010",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><h1>The Eyes Have It</h1></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000011": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000011",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000012": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000012",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>by PHILIP K. DICK</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000013": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000013",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000014": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000014",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000015": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000015",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p class=\"first_paragraph\"><span class=\"first_word\">It was</span> quite by accident I discovered this incredible invasion of Earth by lifeforms from another planet. As yet, I haven’t done anything about it; I can’t think of anything to do. I wrote to the Government, and they sent back a pamphlet on the repair and maintenance of frame houses. Anyhow, the whole thing is known; I’m not the first to discover it. Maybe it’s even under control.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000016": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000016",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000017": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000017",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>I was sitting in my easy-chair, idly turning the pages of a paperbacked book someone had left on the bus, when I came across the reference that first put me on the trail. For a moment I didn’t respond. It took some time for the full import to sink in. After I’d comprehended, it seemed odd I hadn’t noticed it right away.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000018": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000018",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000019": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000019",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>The reference was clearly to a nonhuman species of incredible properties, not indigenous to Earth. A species, I hasten to point out, customarily masquerading as ordinary human beings. Their disguise, however, became transparent in the face of the following observations by the author. It was at once obvious the author knew everything. Knew everything — and was taking it in his stride. The line (and I tremble remembering it even now) read:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000020": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000020",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000021": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000021",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000022": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000022",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… his eyes slowly roved about the room.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000023": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000023",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000024": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000024",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000025": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000025",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Vague chills assailed me. I tried to picture the eyes. Did they roll like dimes? The passage indicated not; they seemed to move through the air, not over the surface. Rather rapidly, apparently. No one in the story was surprised. That’s what tipped me off. No sign of amazement at such an outrageous thing. Later the matter was amplified.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000026": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000026",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000027": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000027",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000028": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000028",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… his eyes moved from person to person.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000029": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000029",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000030": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000030",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000031": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000031",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>There it was in a nutshell. The eyes had clearly come apart from the rest of him and were on their own. My heart pounded and my breath choked in my windpipe. I had stumbled on an accidental mention <a class=\"x-ebookmaker-pageno\"></a>of a totally unfamiliar race. Obviously non-Terrestrial. Yet, to the characters in the book, it was perfectly natural — which suggested they belonged to the same species.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000032": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000032",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000033": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000033",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>And the author? A slow suspicion burned in my mind. The author was taking it rather <em>too easily</em> in his stride. Evidently, he felt this was quite a usual thing. He made absolutely no attempt to conceal this knowledge. The story continued:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000034": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000034",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000035": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000035",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000036": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000036",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… presently his eyes fastened on Julia.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000037": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000037",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000038": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000038",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000039": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000039",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Julia, being a lady, had at least the breeding to feel indignant. She is described as blushing and knitting her brows angrily. At this, I sighed with relief. They weren’t <em>all</em> non-Terrestrials. The narrative continues:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000040": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000040",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000041": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000041",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000042": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000042",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… slowly, calmly, his eyes examined every inch of her.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000043": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000043",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000044": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000044",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000045": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000045",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Great Scott! But here the girl turned and stomped off and the matter ended. I lay back in my chair gasping with horror. My wife and family regarded me in wonder.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000046": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000046",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000047": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000047",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>“What’s wrong, dear?” my wife asked.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000048": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000048",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000049": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000049",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>I couldn’t tell her. Knowledge like this was too much for the ordinary run-of-the-mill person. I had to keep it to myself. “Nothing,” I gasped. I leaped up, snatched the book, and hurried out of the room.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000050": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000050",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000051": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000051",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p class=\"post_thoughtbreak\"><span class=\"first_word\">In the</span> garage, I continued reading. There was more. Trembling, I read the next revealing passage:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000052": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000052",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000053": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000053",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000054": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000054",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… he put his arm around Julia. Presently she asked him if he would remove his arm. He immediately did so, with a smile.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000055": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000055",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000056": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000056",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000057": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000057",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>It’s not said what was done with the arm after the fellow had removed it. Maybe it was left standing upright in the corner. Maybe it was thrown away. I don’t care. In any case, the full meaning was there, staring me right in the face.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000058": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000058",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000059": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000059",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Here was a race of creatures capable of removing portions of their anatomy at will. Eyes, arms — and maybe more. Without batting an eyelash. My knowledge of biology came in handy, at this point. Obviously they were simple beings, uni-cellular, some sort of primitive single-celled things. Beings no more developed than starfish. Starfish can do the same thing, you know.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000060": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000060",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000061": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000061",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>I read on. And came to this incredible revelation, tossed off coolly by the author without the faintest tremor:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000062": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000062",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000063": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000063",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000064": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000064",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… outside the movie theater we split up. Part of us went inside, part over to the cafe for dinner.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000065": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000065",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000066": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000066",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000067": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000067",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Binary fission, obviously. Splitting in half and forming two entities. <a class=\"x-ebookmaker-pageno\"></a>Probably each lower half went to the cafe, it being farther, and the upper halves to the movies. I read on, hands shaking. I had really stumbled onto something here. My mind reeled as I made out this passage:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000068": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000068",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000069": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000069",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000070": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000070",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… I’m afraid there’s no doubt about it. Poor Bibney has lost his head again.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000071": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000071",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000072": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000072",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000073": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000073",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Which was followed by:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000074": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000074",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000075": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000075",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000076": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000076",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… and Bob says he has utterly no guts.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000077": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000077",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000078": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000078",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000079": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000079",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Yet Bibney got around as well as the next person. The next person, however, was just as strange. He was soon described as:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000080": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000080",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000081": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000081",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000082": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000082",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… totally lacking in brains.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000083": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000083",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000084": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000084",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000085": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000085",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p class=\"post_thoughtbreak\"><span class=\"first_word\">There</span> was no doubt of the thing in the next passage. Julia, whom I had thought to be the one normal person, reveals herself as also being an alien life form, similar to the rest:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000086": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000086",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000087": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000087",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000088": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000088",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… quite deliberately, Julia had given her heart to the young man.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000089": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000089",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000090": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000090",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000091": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000091",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>It didn’t relate what the final disposition of the organ was, but I didn’t really care. It was evident Julia had gone right on living in her usual manner, like all the others in the book. Without heart, arms, eyes, brains, viscera, dividing up in two when the occasion demanded. Without a qualm.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000092": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000092",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000093": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000093",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000094": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000094",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… thereupon she gave him her hand.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000095": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000095",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000096": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000096",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000097": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000097",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>I sickened. The rascal now had her hand, as well as her heart. I shudder to think what he’s done with them, by this time.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000098": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000098",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000099": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000099",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000100": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000100",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… he took her arm.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000101": {
            "role": "text",
