        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000102": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000102",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000103": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000103",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>Not content to wait, he had to start dismantling her on his own. Flushing crimson, I slammed the book shut and leaped to my feet. But not in time to escape one last reference to those carefree bits of anatomy whose travels had originally thrown me on the track:</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000104": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000104",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000105": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000105",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000106": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000106",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div><p>… her eyes followed him all the way down the road and across the meadow.</p></div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000107": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000107",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><blockquote class=\"quotation\"><div>\n</div></blockquote></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000108": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000108",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000109": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000109",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>I rushed from the garage and back inside the warm house, as if the accursed things were following me. My wife and children were playing Monopoly in the kitchen. I joined them and played with frantic fervor, brow feverish, teeth chattering.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000110": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000110",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000111": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000111",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>I had had enough of the thing. I want to hear no more about it. Let them come on. Let them invade Earth. I don’t want to get mixed up in it.</p></div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000112": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000112",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div>\n</div></div>"
        },
        "$:/plugins/twpub/af4a1d729288dc07/text/000000113": {
            "role": "text",
            "title": "$:/plugins/twpub/af4a1d729288dc07/text/000000113",
            "type": "text/vnd.twpub",
            "text": "<div class=\"twpub-af4a1d729288dc07-ec834a twpub-af4a1d729288dc07-6b4cd0\"><div><p>I have absolutely no stomach for it.</p></div></div>"
        },
